import { UserOutlined } from '@ant-design/icons';
import { InputNumber } from 'antd';


const DepositFunds = () => (
  <>
    <InputNumber
      prefix="￥"
      style={{
        width: '100%',
      }}
    />
    <br />
    <br />
    <InputNumber
      addonBefore={<UserOutlined />}
      prefix="￥"
      style={{
        width: '100%',
      }}
    />
    <br />
    <br />
    <InputNumber
      prefix="￥"
      disabled
      style={{
        width: '100%',
      }}
    />
    <InputNumber prefix="ꜩ" disabled style={{ width: '100%' }} />
    <Button type="primary" size={'default'}>
        Deposit
    </Button>
  </>
);
export default DepositFunds;
